# plt.plot(num_vals, ideal_pres)



def VanderWaalNum(N, T, V, a, b):
    # out = []
    # for i in N:
    #     P = ((i * kB * T)/(V - i * b)) - (a * (i**2 / V**2))
    #     out.append(P)
    # return out
    P = ((N * kB * T)/(V - N * b)) - (a * (N**2 / V**2))
    return P

